sys_variable_value.value:
(function execute(inputs, outputs) {

  var periodsEstimate = JSON.parse(inputs.periodsEstimate);
  var surgeCapabilities = JSON.parse(inputs.surgeCapabilities);
  var fundingDocument;

  if (inputs.fundingType == "MIPR"){
  	fundingDocument = {
      funding_type: inputs.fundingType,
      mipr_number: inputs.miprNumber
    }
  }
  else if (inputs.fundingType == "FS_FORM"){
    fundingDocument = {
      funding_type: inputs.fundingType,
      gtc_number: inputs.gtcNumber,
      orderNumber: inputs.orderNumber
    }
  }

  // IGCE generated-document payload
  var igce_payload = {
    documentType: "INDEPENDENT_GOVERNMENT_COST_ESTIMATE",
    templatePayload: {
      funding_document: fundingDocument,
      surge_capabilities: surgeCapabilities,
      periods_estimate: periodsEstimate,
    }
  };

  outputs.igce_data = igce_payload;

})(inputs, outputs);

